const App = (props) => {
  const { notes } = props

  return (
    <div>
      <h1>Notes</h1>
      <ul>
        {notes.map((x, k) => {
          console.log('k is', k)
          console.log('x.content is', x.content)
          return (
            <li key={k}>
              {x.content}
            </li>
          )

        }

        )}
      </ul>
    </div>
  )
}

export default App
